    "description": "The allele frequency of the p.Asn346His variant in the USH2A gene is 0.016% (20/126318) of European (Non-Finnish) chromosomes by the Genome Aggregation Database (http://gnomad.broadinstitute.org), which is a low enough frequency to award PM2_Supporting based on the thresholds defined by the ClinGen Hearing Loss Expert Panel for autosomal recessive Usher syndrome (PM2_Supporting). The p.Asn346His variant in USH2A has been reported to segregate with hearing loss in at least 7 families including 13 family members (PP1_S; 10729113, 15241801, 17405132, 25521520, 24160897, 22135276). This variant has been detected in patients with hearing loss in trans with at least 4 pathogenic or suspected-pathogenic variants (PM3_VS; PMID: 15241801, 24160897, 22135276, 26969326). At least one patient with a variant in this gene displayed features of mild to severe hearing loss and retinitis pigmentosa (PP4; PMID: 10729113, 15241801, 17405132, 25521520, 24160897, 22135276). Computational prediction tools and conservation analysis suggest that the p.Asn346His variant may impact the protein (PP3). In summary, this variant meets criteria to be classified as pathogenic for autosomal recessive Usher syndrome based on the ACMG/AMP criteria applied, as specified by the Hearing Loss Expert Panel: PM2_Supporting, PP1_S, PM3_VS, PP4, PP3.",
