    "description": "The filtering allele frequency of the p.Leu79CysfsX3 variant in the GJB2 gene is 0.55% (121/ 18870) of East Asian chromosomes by the Genome Aggregation Database (http://gnomad.broadinstitute.org; calculated by using inverse allele frequency at https://www.cardiodb.org/allelefrequencyapp/), which is a high enough frequency to be classified as benign based on thresholds defined by the ClinGen Hearing Loss Expert Panel for autosomal recessive hearing loss variants (BS1). The ClinGen Hearing Loss Expert Panel believes that the evidence for the pathogenicity of this variant for nonsyndromic hearing loss outweighs the high allele frequency of the variant in population databases. Therefore, the BS1 code will not contribute to the overall classification. The p.Leu79CysfsX3 variant in GJB2 is predicted to cause a premature stop codon in the only exon of the gene, leading to absent protein in a gene in which loss-of-function is an established mechanism (PVS1). This variant has been detected in patients with hearing loss in trans with at least 4 pathogenic or suspected-pathogenic variants (PM3_VS; PMID: 10983956, 10633133). A dye transfer assay, a functional study, has shown that the variant impacts protein function (PS3_M; PMID: 12352684). In summary, this variant meets criteria to be classified as pathogenic for autosomal recessive nonsyndromic hearing loss based on the ACMG/AMP criteria applied, as specified by the Hearing Loss Expert Panel: PVS1, PM3_VS, PS3_M, BS1.",
